import React from "react";
import "./styles/landing.css";

export default function Landing() {
  const styles = {
    backgroundImage: `url(${landing})`,
  };
  return (
    <div className="landing" style={styles}>
      <div className="content">
        <h1>Buy</h1>
        <h1>Sell</h1>
        <p>And browse many different phones.</p>
      </div>
    </div>
  );
}
